import React from 'react';
import Component from './Component';
const food="https://nypost.com/wp-content/uploads/sites/2/2019/09/junk-food-turns-kid-blind.jpg?quality=90&strip=all&w=618&h=410&crop=1"

const Body =()=>{
return(
    <>
    <div className="container-fluid">
        <img src={food} alt="image not found" />
    </div>
    
    </>
    );
};

export default Body;
export {Component};
